import React from "react";

const CurrentEvents = () => {
  return (
    <sections className="current">
      <div className="container">
        <div className="row">
          <div className="col-md-4">1</div>
          <div className="col-md-4">1</div>
          <div className="col-md-4">1</div>
          <div className="col-md-4">1</div>
        </div>
      </div>
    </sections>
  );
};

export default CurrentEvents;
